import React from "react";

class Navbar extends React.Component {
  render() {
    return (
      <nav>
        <ul class="nav nav-tabs">
          <li>
            <a href="https://github.com/jrdorn" target="_blank">
              Projects
            </a>
          </li>
          <li>
            <a href="resume.pdf" target="_blank">
              Resume
            </a>
          </li>
        </ul>
      </nav>
    );
  }
}

export default Navbar;
